postcontent:
This is a great stock in amazing condition. Retails for approx $350+. It is the textured black version. The few places that sell these are sold out from what I have seen and have been like that for awhile. Completely free floated and aluminum bedded for increased accuracy. The "hook" part of the stock is great when you are aiming because it allows you to snuggle your offhand (left hand) into the stock for increased stability instead of trying to get a good purchase on the back-end of the factory stock. Details listed below. 

+ Fits factory hinged floorplate and M4 Upgraded Magazine System;
+ Cut for the standard Rem #3 Varmint / Tactical barrel;
+ Easily modified for 5R mil. spec. and most other heavy contours;
+ Includes the 700 SPS, XCR, VTR Varmint and Tactical type rifles.
"The Hook" is designed as a “drop-in” for the heavy barrel Remington Model 700 BDL or DBM (short action). It has an extended grip and a fairly wide forend with dual front sling studs to allow for both bipod and sling attachment. The hooked cutout underside is designed as a steady-holding feature - simply jam your off-hand into the recess for an isometrically-solidified rest, ideal for varmint, target or tactical field applications!
The stock has no checkering and like all in the “Medalist” line, it has the integral aluminum bedding system that is computer designed and CNC machined out of aircraft grade 6061-T6 aluminum. The aluminum block extends through the forearm to add strength and stiffness and incorporates the attachment of the front sling swivel for additional security. An aluminum “tail piece” also extends from the bedding block through the grip area to add rigidity and to strengthen the stock. The stock is designed to be “free-floated” and it comes with a standard length of pull of 13 3/4” with a Pachmayr Decellerator pad.
